module.exports=function(){function Complex(re=0,im=0){this.re=re;this.im=im}const msgs={errNotNumeric:"{0} must be a number."};Complex.prototype.getMsg=function(key,repArr=null){const msg=msgs[key];return repArr?msg.replace(/{(\d+)}/g,((match,i)=>repArr[i]!==undefined?repArr[i]:match)):msg};Complex.prototype.setRe=function(value){if(typeof value!=="number"){throw new Error(this.getMsg("errNotNumeric",["Specified value"]))}this.re=value;return this};Complex.prototype.setIm=function(value){if(typeof value!=="number"){throw new Error(this.getMsg("errNotNumeric",["Specified value"]))}this.im=value;return this};return Complex}();